import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header style={{ padding: '10px', background: '#E3F6FD' }}>
      <h1>Doctro</h1>
      <nav>
        {/* Existing navigation items */}
        <Link to="/" style={{ margin: '10px' }}>Home</Link>
        <Link to="/services" style={{ margin: '10px' }}>Our Services</Link>
        <Link to="/about" style={{ margin: '10px' }}>About Us</Link>

        {/* New Login Links */}
        <Link to="/doctor-form" style={{ margin: '10px' }}>Doctor Login</Link>
        <Link to="/patient-form" style={{ margin: '10px' }}>Patient Login</Link>
      </nav>
    </header>
  );
}

export default Header;
